%------------------------------------------------------------------------------
% Project:      MOTEL 1.0
% Module:       folToClause.pl
% Purpose:      Translation of first-order logic formulae to clauses
% Last Change:  04.02.93
% Language:     Prolog
% Author:       Ullrich Hustadt
% Address:      Max-Planck-Institut for Computer Science
%               Im Stadtwald
%               6600 Saarbr"ucken
%               Germany
% Email:        Ullrich.Hustadt@mpi-sb.mpg.de
% Copyright:    (C) 1993 Ullrich Hustadt
% Copying:      This software is provided under the GNU General Public License.
% Warranty:     This is a research prototype. There is absolutely no warranty.
%------------------------------------------------------------------------------
%
% Syntax of first-order logic formulae
% ====================================
% Atom    => in(X,ConceptName)
%            eq(PrologTerm,PrologTerm)
%            rel(RoleName,PrologTerm,PrologTerm)
%         
% Formula =>   Atom
%            | and([Formula,Formula]) 
%            | or([Formula,Formula])
%            | not(Formula)
%            | implies(Formula,Formula)
%            | equivalent(Formula,Formula)
%            | forall(PrologVar,Formula)
%            | exists(PrologVar,Formula)
% 
% Syntax of clauses
% =================
% Clause  => cl(Head,Body)
% Head    =>   []
%            | [Atom|Head]
% Body    =>   []
%            | [Atom|Body]
    
%----------------------------------------------------------------------
% translate(+F,-C)
% Parameter: F   First-order formula
%            C   Clause

translate(X,Clauses) :-
	implout(X,X1),
	negin(X1,X2),
	mskolem(X2,X3,[]),
	univout(X3,X4),
	conjn(X4,X5),
	clausify(X5,Clauses,[]).


%----------------------------------------------------------------------
% implout(+F1,-F2)
% Arguments: F1   First-order formula
%            F2   First-order formula
% removes implications and equivalences in F1 resulting in F2
%
% Author: Ullrich Hustadt

implout(equivalent(P,Q),or([and([P1,Q1]),and([not(P1),not(Q1)])])) :-
	!,
	implout(P,P1),
	implout(Q,Q1).
implout(implies(P,Q),or([not(P1),Q1])) :-
	!,
	implout(P,P1),
	implout(Q,Q1).
implout(forall(X,P),forall(X,P1)) :-
	!,
	implout(P,P1).
implout(exists(X,P),exists(X,P1)) :-
	!,
	implout(P,P1).
implout(and(L),and(L1)) :-
	!,
	map(implout,L,L1).
implout(or(L),or(L1)) :-
	!,
	map(implout,L,L1).
implout(not(P),not(P1)) :-
	!,
	implout(P,P1).
implout(P,P).

%----------------------------------------------------------------------
% negin(+F1,-F2)
% Parameter: F1   First-order formula
%            F2   First-order formula
% computes the negation normal form of F1 
%
% Author: Ullrich Hustadt

negin(not(P),P1) :-
	!,
	neg(P,P1).
negin(forall(X,P),forall(X,P1)) :-
	!,
	negin(P,P1).
negin(exists(X,P),exists(X,P1)) :-
	!,
	negin(P,P1).
negin(and(L),and(L1)) :-
	!,
	map(negin,L,L1).
negin(or(L),or(L1)) :-
	!,
	map(negin,L,L1).
negin(P,P).

%----------------------------------------------------------------------
% neg(+F1,-F2)
% Parameter: F1   First-order formula
%            F2   First-order formula
% negates formula F1 to get F2
%
% Author: Ullrich Hustadt

neg(not(P),P1) :-
	!,
	negin(P,P1).
neg(forall(X,P),exists(X,P1)) :-
	!,
	neg(P,P1).
neg(exists(X,P),forall(X,P1)) :-
	!,
	neg(P,P1).
neg(and(L),or(L1)) :-
	!,
	map(neg,L,L1).
neg(or(L),and(L1)) :-
	!,
	map(neg,L,L1).
neg(P,not(P)).

%----------------------------------------------------------------------
% mskolem(+F1,-F2,*Vars)
% Parameter: F1     First-order formula
%            F2     First-order formula
%            Vars   List of variables
% F2 is the skolemized form of F1.
%
% Author: Ullrich Hustadt

mskolem(forall(X,P),forall(X,P1),Vars) :-
	!,
	mskolem(P,P1,[X|Vars]).
mskolem(exists(X,P),P2,Vars) :-
	!,
	mskolem(P,P1,Vars),
	gensym(f,F),
	Sk =.. [F|Vars],
	motel_subst(P1,P2,X,Sk).
mskolem(and(L),and(L1),Vars) :-
	!,
	map(mskolem,[Vars],L,L1).
mskolem(or(L),or(L1),Vars) :-
	!,
	map(mskolem,[Vars],L,L1).
mskolem(P,P,_).


%----------------------------------------------------------------------
% motel_subst(+F1,-F2,+X,+Sk)
% Parameter: F1     First-order formula
%            F2     First-order formula
%            X      Variable that will be substituted
%            Sk     Skolem term 
% substitutes Sk for X in formula F1.
% 
% Author: Ullrich Hustadt

motel_subst(T1,T2,X,Sk) :-
	(atomic(T1) ; var(T1)),
	T1 == X,
	!,
	T2 = Sk.
motel_subst(T1,T2,X,_Sk) :-
	(atomic(T1) ; var(T1)),
	not(T1 == X),
	!,
	T2 = T1.
motel_subst(forall(Y,P),forall(Y,P),X,_Sk) :-
	X == Y,
	!.
motel_subst(forall(Y,P),forall(Y,P1),X,Sk) :-
	!,
	motel_subst(P,P1,X,Sk).
motel_subst(exists(Y,P),exists(Y,P),X,_Sk) :-
	X == Y,
	!.
motel_subst(exists(Y,P),exists(Y,P1),X,Sk) :-
	!,
	motel_subst(P,P1,X,Sk).
motel_subst(and(L),and(L1),X,Sk) :-
	!,
	map(motel_subst,[X,Sk],L,L1).
motel_subst(or(L),or(L1),X,Sk) :-
	!,
	map(motel_subst,[X,Sk],L,L1).
motel_subst(not(P),not(P1),X,Sk) :-
	!,
	motel_subst(P,P1,X,Sk).
motel_subst(T1,T2,X,Sk) :-
	!,
	T1 =.. [F|Args],
	map(motel_subst,[X,Sk],Args,Args1),
	T2 =.. [F|Args1].

%----------------------------------------------------------------------
% univout(+F1,-F1)
% Parameter: F1   First-order formula
%            F2   First-order formula
% removes quantifiers
%
% Author: Ullrich Hustadt

univout(forall(_X,P),P1) :-
	!,
	univout(P,P1).
univout(and(L),and(L1)) :-
	!,
	map(univout,L,L1).
univout(or(L),or(L1)) :-
	!,
	map(univout,L,L1).
univout(P,P).

%----------------------------------------------------------------------
% conjn(+F1,-F2)
% Parameter: F1   First-order formula
%            F2   First-order formula
% computes the conjunctive normal form of F1
%
% Author: Ullrich Hustadt

conjn(and(L),R) :-
	!,
	map(conjn,L,L1),
	conjn1(and(L1),R).
conjn(or(L),R) :-
	!,
	map(conjn,L,L1),
	conjn1(or(L1),R).
conjn(P,P).

conjn1(or([and([P,Q]),R]),and([P1,Q1])) :-
	!,
	conjn(or([P,R]),P1),
	conjn(or([Q,R]),Q1).
conjn1(or([R,and([P,Q])]),and([P1,Q1])) :-
	!,
	conjn(or([P,R]),P1),
	conjn(or([Q,R]),Q1).
conjn1(P,P).

clausify(and([P,Q]),C1,C2) :-
	!,
	clausify(P,C1,C3),
	clausify(Q,C3,C2).
clausify(P,[cl(A,B)|Cs],Cs) :-
	inclause(P,A,[],B,[]),
	!.
clausify(_,C,C).

inclause(or([P,Q]),A,A1,B,B1) :-
	!,
	inclause(P,A2,A1,B2,B1),
	inclause(Q,A,A2,B,B2).
inclause(not(P),A,A,B1,B) :-
	!,
	not(memq(P,A)),
	motel_putin(P,B,B1).
inclause(P,A1,A,B,B) :-
	not(memq(P,B)),
	motel_putin(P,A,A1).

motel_putin(X,[],[X]) :-
	!.
motel_putin(X,[Y|L],L) :-
	X == Y,
	!.
motel_putin(X,[Y|L],[Y|L1]) :-
	motel_putin(X,L,L1).


	
memq(_X,[]) :-
	!,
	fail.
memq(X,[Y|_L]) :-
	X == Y,
	!.
memq(X,[_|L]) :-
	memq(X,L).
	
	


