	getQuery(Env,W1,CN,X,PT,G),
%	G = call((in(Env,RN,modal(W1),CN,X,hyp(HYPS),ab(AB),call(CALLS),PT), G1)),
	!.

	
nongeneric(X) :-
	var(X),
	!.
nongeneric(aaa) :-
	!,
	fail.
nongeneric(_) :-
	!.


ground(T,Result) :-
	var(T),
	!,
	Result = false.
ground(T,Result) :-
	atomic(T),
	!,
	Result = true.
ground(T,Result) :-
	T =.. [F|Args],
	map(ground,Args,Results),
	member(false,Results),
	!,
	Result = false.
ground(T,true) :-
	!.
