	constructMLCall(Env,rn(no,_RN1,user,_O1),bodyMC(W1),headMC(_),
			C0,X,[or([]),rl([]),fl(_DML1)],noAb,[],Exp,Goal).

performQuery(X,G1,Goal) :-
	nonvar(X),
